import React from 'react';
import ContentForm from './components/ContentForm';
import ContentList from './components/ContentList';

const App = () => {
  return (
    <div>
      <h1>Content Management System</h1>
      <ContentForm />
      <ContentList />
    </div>
  );
};

export default App;
